import { BrowserRouter, Route, Routes } from "react-router-dom";
import "./App.css";
import { Navbar } from "./Components/Navbar";

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Routes>
        {/* <Route path="/" element={<Listing/>} */}
        <Route path="/form">
          <Route path=":movieId" element={<Form />}></Route>
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
